import * as React from 'react';
import './App.css';

const Header = (props) => {

  const handleDiv = () => {
    alert("Este es el header");
  }

  return(
    <div onClick={handleDiv}>
        {props.title}
        {props.subTitle}
    </div>
  );
}

export default Header;
